var socket = io();

// Main Menu Specific ------------------------------------------------------------------
var mainMenuContainer = document.querySelector('.main-menu-container');
var groupInput = document.querySelector('#group-input');
var usernameInput = document.querySelector('#username-input');
var joinButton = document.querySelector('#join-button');

joinButton.addEventListener('click', () => {
  if (groupInput.value && usernameInput.value) {
    socket.emit('join group', { group: groupInput.value, username: usernameInput.value });
    groupInput.value = '';
    usernameInput.value = '';

    // hide form to reveal game behind it
    mainMenuContainer.classList.add('hidden');
  } else {
    // do nothing, wait for them to fill out form
  }
});
// end Main Menu -----------------------------------------------------------------------

socket.on('new state', (state) => {
  groupName = state.groupName;
  renderGame(state);
});

