var groupName = '';

const onScreenPlayers = document.querySelector('#players');
const onScreenDeck = [...document.querySelector('#deck').children][0];
const onScreenPile = document.querySelector('#pile');
const onScreenHand = document.querySelector('#hand');

onScreenDeck.addEventListener('click', drawCard);
onScreenPile.addEventListener('click', undoCard);
onScreenHand.addEventListener('click', playCard);

function drawCard() {
  socket.emit('draw card', {groupName, playerId: socket.id});
}

function undoCard() {
  socket.emit('undo card', {groupName, playerId: socket.id});
}

function playCard(e) {
  if ([...onScreenHand.children].length > 0) {
    const cardIndex = e.target.id;
    if (!isNaN(cardIndex)) {
      socket.emit('play card', {groupName, cardIndex: cardIndex});
    } else {
      // do nothing - cardIndex is not a number
    }
  } else {
    // do nothing - no cards in hand to play
  }
}

function findPlayerBySocketId(group) {
  let players = group.players;
  let ownPlayer = players.filter( (player) => {
    return player.id == socket.id;
  });
  return ownPlayer[0];
}

function renderGame(state) {
  let players = '';
  state.players.forEach( player => {
    players = players + `<div class="player">${player.hand.length} - ${player.username}</div>`;
  });
  onScreenPlayers.innerHTML = players;
  onScreenPile.innerHTML = `<div class="card-container">${cards[state.pile[state.pile.length-1]]}</div>`;

  let ownPlayer = findPlayerBySocketId(state);
  let handHTML = '';
  ownPlayer.hand.forEach((card, index) => {
    handHTML = handHTML + `<div class="card-container" id=${index}>${cards[card]}</div>`;
  });
  onScreenHand.innerHTML = handHTML;
}
